def _delete_sub_key(key0, current_key, arch_key=0):
    try:
        open_key = winreg.OpenKey(key0, current_key, 0, winreg.KEY_ALL_ACCESS | arch_key)
    except FileNotFoundError:
        exit(0)
    sub_key = 'Automator'
    try:
            winreg.DeleteValue(open_key, sub_key)
    except OSError as e:
            print(e)
            _delete_sub_key(key0, "\\".join([current_key,sub_key]), arch_key)
            # No extra delete here since each call
            # to delete_sub_key will try to delete itself when its empty.

            winreg.DeleteValue(open_key, "")
            open_key.Close()
            return

def set_reg_key(value = None):
    value = '\"{}\" {}'.format(value[0], ' '.join(value[1:]))
    if value == None:
        return
    return _set_reg('Automator', value)

def delite_sub_key(hwnd=None):
    return _delete_sub_key(winreg.HKEY_CURRENT_USER, REG_PATH, winreg.REG_SZ, None if not hwnd else hwnd)

